export async function isAuthenticated(token){
    console.log(token);
    var test = {
        test: "hello"
    }
    const response = await fetch('/api/isAuth', {
        method: 'POST',
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify(test)
    });

    return await response.json();
}
